import React, { Component } from "react";
import { Link } from "react-router-dom";

class Header extends Component {
  render() {
    return (
      <div>
        <Link to="/">Logotype</Link>
        <input type="Search" />
        <Link to="/account">My account</Link>
        <Link to="/cart">Cart</Link>
      </div>
    );
  }
}

export default Header;
